import React from 'react';
import '../../styles/Home/AiChat.css';

const AiChat = () => {
  return (
    <section className="ai-chat">
      <div className="container">
        <h3>Talk to our AI Agent</h3>
        <button>Start Chat</button>
      </div>
    </section>
  );
};

export default AiChat;
